gql:
mutation generateAPIKey($generateAPIKey_key: CreateAPIKey!) {
  generateAPIKey(key: $generateAPIKey_key)
}
query JustConversationWithGpt($chatGPT35Turbo_input: GPT35_Input!) {
  ai {
    conversational {
      chatGPT35Turbo(input: $chatGPT35Turbo_input) {
        message {
          content
          role
        }
      }
    }
  }
}
